import React from 'react'

const SetBirthyear = (props) => {

    if (!props.show) {
        return null
      }


    return (
        <div>
            <div>
                <input>Name:</input>
            </div>

            <div>
                <input>Birthyear:</input>
            </div>
        </div>
    )



}


export default SetBirthyear
